	//GESTURE DETECTOR
	private GestureDetector createGestureDetector(Context context) {
		GestureDetector gestureDetector = new GestureDetector(context);
		// Create a base listener for generic gestures
		gestureDetector.setBaseListener(new GestureDetector.BaseListener() {
			@Override
			public boolean onGesture(Gesture gesture) {
				//6. DONE:
				if (gesture == Gesture.TAP) {
					if (imgIndex==-1) return true;
					// Intent Creation and Initialization
					Intent intent = new Intent(context2, CardScrollActivityOne.class);
//I have added the line: (flags) (for closing the first activity)
					intent.setFlags(Intent.FLAG_ACTIVITY_CLEAR_TOP);
					// Create a Bundle and Put Bundle into it (SENDS PERSON)
					Bundle bundleObject = new Bundle();
					bundleObject.putSerializable("key",ListOfPersons.get(imgIndex) );
					// Put Bundle into Intent and call start Activity
					intent.putExtras(bundleObject);
					startActivity(intent);
//I have added the line: (finish) (for closing the first activity)
					//finish();
					return true;
				} else if (gesture == Gesture.TWO_TAP) {

					return true;
				} else if (gesture == Gesture.SWIPE_RIGHT) {
					// do something on right (forward) swipe
					imgIndex++;

					if (imgIndex < ListOfPersons.size()) {
						
						if (ListOfPersons.get(imgIndex).getPicture()==null) ListOfPersons.get(imgIndex).setPicture(noPicture);
						
						byte[] decodedString = Base64.decode(
								ListOfPersons.get(imgIndex).getPicture(),
								Base64.DEFAULT);

						Bitmap decodedByte = BitmapFactory.decodeByteArray(
								decodedString, 0, decodedString.length);

						img.setImageBitmap(decodedByte);
					} else {
						imgIndex--;
					}
					return true;
				} else if (gesture == Gesture.SWIPE_LEFT) {
					// do something on left (backwards) swipe
					imgIndex--;

					if (imgIndex > -1) {
						
						if (ListOfPersons.get(imgIndex).getPicture()==null) ListOfPersons.get(imgIndex).setPicture(noPicture);
						byte[] decodedString = Base64.decode(
								ListOfPersons.get(imgIndex).getPicture(),
								Base64.DEFAULT);

						Bitmap decodedByte = BitmapFactory.decodeByteArray(
								decodedString, 0, decodedString.length);

						img.setImageBitmap(decodedByte);
					} else {
						imgIndex++;
					}
					return true;
				} else  if (gesture == Gesture.LONG_PRESS){
		    		Intent intent = new Intent(InformationPreviewActivity.this, MainManuActivity.class);
		    		intent.setFlags(Intent.FLAG_ACTIVITY_CLEAR_TOP);		
		    		startActivity(intent);
		    		finish();
		        	return true;
		        }
				return false;
			}
		});
		gestureDetector.setFingerListener(new GestureDetector.FingerListener() {
			@Override
			public void onFingerCountChanged(int previousCount, int currentCount) {
				// do something on finger count changes
			}
		});
		gestureDetector.setScrollListener(new GestureDetector.ScrollListener() {
			@Override
			public boolean onScroll(float displacement, float delta,
					float velocity) {
				// do something on scrolling
				return true;
			}
		});
		return gestureDetector;
	}

	/*
	 * Send generic motion events to the gesture detector
	 */
	@Override
	public boolean onGenericMotionEvent(MotionEvent event) {
		if (mGestureDetector != null) {
			return mGestureDetector.onMotionEvent(event);
		}
		return false;
	}

	public void getData()
	{ 
		try {
			Gson gson = new Gson();
			   
        	    InputStream inputStream=null;
        	    String result= "";
        	    String json = "";
//capturedPhoto="";
         	    // make JSON
   	         	JSONObject object=new JSONObject();
   	         	// "f46fc34f-47ab-4848-b77e-20e77fd65d8e"
   	         	object.put("IdUser", IdUser);
   	         	object.put("Picture", capturedPhoto);       
   	         	//create HttpClient
   	         	@SuppressWarnings("deprecation")
   	         	HttpClient httpclient = new DefaultHttpClient();
   	         	//  make POST request to the given URL
        	    String url=String.format("http://%s/friends/api/friend/PostRequest", IPaddress);
        	    System.out.println(url);
   	         	HttpPost httpPost = new HttpPost(url);  	         
   	         	// convert JSONObject to JSON to String
   	         	json = object.toString();    
   	         	//  set json to StringEntity
   	         	StringEntity se = new StringEntity(json);
   	         	//  set httpPost Entity
   	         	httpPost.setEntity(se);
   	         	//  set some headers to inform server about the type of the content   
   	         	httpPost.setHeader("Accept", "application/json");
   	         	httpPost.setHeader("Content-type", "application/json");
   	         	//  Execute POST request to the given URL
   	         	HttpResponse httpResponse = httpclient.execute(httpPost);
   	         	//  receive response as inputStream
   	         	inputStream = httpResponse.getEntity().getContent();

   	         	//  convert inputstream to string
   	         	if(inputStream != null)
   	         	{
   	         		BufferedReader bufferedReader = new BufferedReader( new InputStreamReader(inputStream));
   	         		String line = "";
   	         		result = "";
   	         		while((line = bufferedReader.readLine()) != null)
   	         			result += line;
       	  
   	         		inputStream.close();
       	          
   	         	}
   	         	else
   	         		result = "Did not work!";


   	         	// return result
   	         	System.out.println(result);         	   
  	            	                 	         	             	       	    
    if (result=="[]") result="Did not work!"; 
    
   	   Object obj = new JSONTokener(result).nextValue();
   	   
   	if(obj instanceof JSONObject){
   		
   	   RecognizedPerson per=gson.fromJson(result, RecognizedPerson.class);
   	   if (per.getFirstName()==null || per.getLastName()==null) {imgIndex=-1; return; }
   	   ListOfPersons=new ArrayList<RecognizedPerson>();
   	   ListOfPersons.add(per);
   		
   	}
   	else if (obj instanceof JSONArray){
   	   
		Type collectionType = new TypeToken<Collection<RecognizedPerson>>(){}.getType();
		Collection<RecognizedPerson> persons = gson.fromJson(result, collectionType);
		ListOfPersons = new ArrayList<RecognizedPerson>(persons);
		if (ListOfPersons.get(0).getFirstName()==null || ListOfPersons.get(0).getLastName()==null) {imgIndex=-1; ListOfPersons.clear(); return; }
   		
   	} 
   	else {
   		imgIndex=-1;
   	}
   	      
	   } catch(Exception e){
		   imgIndex=-5;
		   System.out.println(e.getMessage());  
       }
	}
		
	private class BackgroundWorker extends AsyncTask<Object,Object,Object>{

		@Override
		protected Object doInBackground(Object... params) {

		try {
			
		getData();
		
		} catch (Exception e) {

		e.printStackTrace();
		}

		return null;
		}

		@Override
		// On UI
		protected void onPostExecute(Object result) {
		super.onPostExecute(result);
		dialog.dismiss();
		
		if (imgIndex!=-1 && imgIndex!=-5) StartInfoPreview();
		if (imgIndex==-1) {
			Intent intent = new Intent(context2, FailedRecognitionActivity.class);
			intent.setFlags(Intent.FLAG_ACTIVITY_CLEAR_TOP);		
			startActivity(intent);
			finish();
		}
		if(imgIndex==-5){
			Intent intent = new Intent(context2, FailedConnectionActivity.class);
			intent.setFlags(Intent.FLAG_ACTIVITY_CLEAR_TOP);		
			startActivity(intent);
			finish();
			imgIndex=-1;
		}

		}
		}
	
	
